import React from 'react';

const Signup = () => {
  return (
    <div className='w-full p-6 rounded-lg shadow-md bg-gray-400h-full w-full bg-gray-500 bg-clip-padding backdrop-filter  backdrop-blur bg-opacity-50 backdrop-saturate-100 backdrop-contrast-100 '>
      <h1 className='text-3xl font-bold text-center text-gray-300'>Signup</h1>
    </div>
  );
}

export default Signup;
